css:
@-moz-document domain("roblox.com")
{
/* Glitter Roblox Logo */
  .icon-logo,
.light-theme .icon-logo,
.dark-theme .icon-logo
  {
    background-image: url("https://i.ibb.co/DprCbBt/Whole-Roblox-pink.png");
  }

  .icon-logo-r,
.light-theme .icon-logo-r,
.dark-theme .icon-logo-r,
.icon-logo-r-95,
.light-theme .icon-logo-r-95,
.dark-theme .icon-logo-r-95
  {
    background-image: url("https://i.ibb.co/CMwZzjr/Roblox-pink.png");
  }
}
